That's a big ask! Writing an entire game in one response would be quite lengthy and complex. However, I can provide you with a basic structure and some example scripts to get you started on creating a simple 2D platformer in Unity3D.

Here's a breakdown of the components we'll need:

**Game Objects**

1. Player: A 2D sprite that represents our hero.
2. Platforms: Static or dynamic platforms for the player to jump between.
3. Enemies: Optional enemies for added challenge.
4. UI elements (e.g., score display).

**Scripts**

We'll need the following scripts:

### PlayerController.cs

```csharp

using UnityEngine;

public class PlayerController : MonoBehaviour {

    // Movement Variables

    public float speed = 5f;
    private bool isGrounded = true;
    public float jumpForce = 7f;
    private float moveX;

    // References to other components

    private Rigidbody2D rb;

    void Start() {
        rb = GetComponent<Rigidbody2D>();
    }

    void Update() {
        moveX = Input.GetAxis("Horizontal");
    }

    void FixedUpdate() {
        Vector2 movement = new Vector2(moveX, 0);

        rb.velocity = new Vector2(movement.x * speed, rb.velocity.y);

        if (!isGrounded && Input.GetButtonDown("Jump")) {
            Jump();
        }
    }

    void OnCollisionEnter2D(Collision2D collision) {
        if (collision.gameObject.CompareTag("Platform"))
            isGrounded = true;
    }

    void OnCollisionExit2D(Collision2D collision) {
        if (collision.gameObject.CompareTag("Platform"))
            isGrounded = false;
    }

    void Jump()
    {
        rb.AddForce(new Vector2(0f, jumpForce), ForceMode2D.Impulse);
    }
}
```

This script handles user input for moving left and right, as well as jumping when on the ground.

