    float4x4 ModelMatrix;
};

texture NormalMap < string Name = "NormalMap"; >;
texture HeightMap < string Name = "HeightMap"; >;

sampler NormalSampler = sampler_state {
    Texture = (NormalMap);
    AddressU = CLAMP;
    AddressV = CLAMP;
    Filter = ANISOTROPIC;
};

sampler HeightSampler = sampler_state {
    Texture = (HeightMap);
    AddressU = CLAMP;
    AddressV = CLAMP;
    Filter = LINEAR;
